import React from "react";

function Homepage() {
    return <div>HomePage</div>;
}

<div className='mainWrapper'>
    <div className='list'>
        <h2>Posts</h2>
        {Array.isArray(posts) &&
            posts.map(post => {
                return (
                    <Link
                        key={post.id}
                        className='postItem'
                        to={`/posts/${post.id}`}
                    >
                        <h3>{post.title}</h3>
                        <p>{post.body}</p>
                    </Link>
                );
            })}
    </div>
</div>;

export default Homepage;
